import React from 'react';
/*Black box style*/
let BlackBoxStyle = {
  width:"32%",
  height:"100px",
  margin:"100px auto",
  backgroundColor: "black",
  fontSize: "30px",
  textAlign: "center",
  color: "yellow",
  padding: "100px",
  float: "left"
}
/*Red box style*/
let RedBoxStyle = {
  width:"32%",
  height:"100px",
  margin:"100px auto",
  backgroundColor: "red",
  fontSize: "30px",
  textAlign: "center",
  color: "blue",
  padding: "100px",
  float: "left"
}
/*Green Box style*/
let GreenBoxStyle = {
  width:"32%",
  height:"100px",
  margin:"100px auto",
  backgroundColor: "green",
  fontSize: "30px",
  textAlign: "center",
  color: "white",
  padding: "100px",
  float: "left"
}


let BlackBox = () => <div style = {BlackBoxStyle}> Yellow In Black </div>;
let RedBox = () => <div style = {RedBoxStyle}> Blue In Red </div>;
let GreenBox = () => <div style = {GreenBoxStyle}> White In Green </div>;
function App() {

  return (
    <div>
      <BlackBox/>
      <RedBox/>
      <GreenBox/>
    </div>
  );
}

export default App;
